import React from 'react'
import CardList from './CardList.js'
import { robots } from './robots';
import SearchBox from 'SearchBox.js'

const App = () => {
    return (
        <div> 
            <h1> Robot Friends </h1>
            <SearchBox />
            <CardList robots={ robots }/>
        </div>
        
    );
}

export default App;
